//import React, { useState, useEffect } from 'react';
import { BrowserRouter, Route, Switch, /*Link*/ } from 'react-router-dom';

import './App.css';
import Register from './Register';
import Login from './Login';
import Activate  from './activate';
import BootstrapNavbar from './bootstrapNavbar';

async function LoginGoogle() {
  const data = await fetch('http://localhost:2400/auth/google/url', {
  method: 'GET',
  credentials: 'include'
});
return await data.json();
}
const LoginGoogleFunc = async e => {
  e.preventDefault();
  const response = await LoginGoogle();
  console.log(response);
  window.location.assign(response.url);
}

function App() {
    return (

    <div>
    <BrowserRouter>
      {/* <Link to="/register"><button>Rejestracja</button></Link><br />
      <Link to="/login"><button>Logowanie</button></Link><br />
    <Link to="/activate"><button>Aktywacja</button></Link><br /> */}
        <BootstrapNavbar /> 
    <button onClick={LoginGoogleFunc}>test</button>
         <Switch>
          <Route path="/register">
            <Register />
          </Route>
          <Route path="/login">
           <Login />
          </Route>
          <Route path="/activate">
           <Activate />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
    );
}

export default App;
